import React, { useEffect, useState } from "react";
import "./business-segments-tabs.css";
import axios from "axios";
import Api from "../../Api/Api";
import {
  BsFillArrowRightCircleFill,
  BsFillArrowLeftCircleFill,
} from "react-icons/bs";

function Businesssegmentstabs() {
  const [salesData, setSalesData] = useState([]);
  const [costOfSalesData, setCostOfSalesData] = useState([]);
  const [netIncomeData, setNetIncomeData] = useState([]);
  const [totalAssetsData, setTotalAssetsData] = useState([]);
  const [totalLiabilitiesData, setTotalLiabilitiesData] = useState([]);
  const [currency, setCurrency] = useState("Riyal");
  const [fiscalPeriodType, setFiscalPeriodType] = useState("year");
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    Api.getAccessToken();

    axios
      .get(
        `https://data.argaam.com/api/v1.0/json/ir-api/business-segments?fiscalPeriodType=${fiscalPeriodType}&currency=${currency}`,
        {
          headers: {
            authorization: `Bearer ${localStorage.getItem("token")}`,
          },
        }
      )
      .then((response) => {
        setSalesData(response.data.fsFields[3].businessSegments);
        setCostOfSalesData(response.data.fsFields[4].businessSegments);
        setNetIncomeData(response.data.fsFields[0].businessSegments);
        setTotalAssetsData(response.data.fsFields[1].businessSegments);
        setTotalLiabilitiesData(response.data.fsFields[2].businessSegments);
        setTimeout(() => {
          setLoading(true);
          console.log(response.data);
          console.log(salesData);
        }, 1000);
      });
  }, [fiscalPeriodType, currency]);

  if (!loading) {
    return <div>loading...</div>;
  } else {
    return (
      <div className="business-segments container">
        <div className="header-of-tabs">
          <div className="tabs-container">
            <span className="tabs">
              {" "}
              <a
                className="btn btn-light"
                id="annual"
                onClick={() => {
                  setFiscalPeriodType("year");
                  document.getElementById("annual").classList.add("active");
                  document.getElementById("quarter").classList.remove("active");
                  document.getElementById("interim").classList.remove("active");
                }}
              >
                ANNUAL
              </a>
            </span>
            <span className="tabs">
              {" "}
              <a
                className="btn btn-light"
                id="quarter"
                onClick={() => {
                  setFiscalPeriodType("quarter");
                  document.getElementById("annual").classList.remove("active");
                  document.getElementById("quarter").classList.add("active");
                  document.getElementById("interim").classList.remove("active");
                }}
              >
                QUARTER
              </a>
            </span>
            <span className="tabs">
              {" "}
              <a
                className="btn btn-light"
                id="interim"
                onClick={() => {
                  setFiscalPeriodType("Interim");
                  document.getElementById("annual").classList.remove("active");
                  document.getElementById("quarter").classList.remove("active");
                  document.getElementById("interim").classList.add("active");
                }}
              >
                INTERIM
              </a>
            </span>
          </div>

          <div className="currency-container text-end">
            <div className="currency">
              <span>Currency : </span>

              <span>
                <a
                  className="btn btn-light"
                  id="riyal-btn"
                  onClick={() => {
                    document
                      .getElementById("riyal-btn")
                      .classList.add("active");
                    document
                      .getElementById("usd-btn")
                      .classList.remove("active");
                    setCurrency("RIYAL");
                  }}
                >
                  RIYAL
                </a>
              </span>
              <span>
                <button
                  className="btn btn-light"
                  id="usd-btn"
                  onClick={() => {
                    document.getElementById("usd-btn").classList.add("active");
                    document
                      .getElementById("riyal-btn")
                      .classList.remove("active");
                    setCurrency("USD");
                  }}
                >
                  USD
                </button>
              </span>
            </div>

            <div className="my-5">
              <table className="center" style={{ width: "100%" }}>
                <tbody>
                  <tr>
                    <td>
                      <BsFillArrowLeftCircleFill />
                    </td>

                    <td>{salesData[0].periodicValues[0].forDate}</td>

                    <td>{salesData[0].periodicValues[1].forDate}</td>

                    <td>{salesData[0].periodicValues[2].forDate}</td>

                    <td>{salesData[0].periodicValues[3].forDate}</td>

                    <td>{salesData[0].periodicValues[4].forDate}</td>

                    <td>{salesData[0].periodicValues[5].forDate}</td>

                    <td>
                      <BsFillArrowRightCircleFill />
                    </td>
                  </tr>

                  <tr>
                    <td style={{ fontSize: "25px" }}>SalesIncome</td>
                  </tr>

                  <tr>
                    <td>{salesData[0].businessSegmentNameEn}</td>
                    <td>{salesData[0].periodicValues[0].value.toFixed(2)}</td>
                    <td>{salesData[0].periodicValues[1].value.toFixed(2)}</td>
                    <td>{salesData[0].periodicValues[2].value.toFixed(2)}</td>
                    <td>{salesData[0].periodicValues[3].value.toFixed(2)}</td>
                    <td>{salesData[0].periodicValues[4].value.toFixed(2)}</td>
                    <td>{salesData[0].periodicValues[5].value.toFixed(2)}</td>
                  </tr>
                  <tr>
                    {" "}
                    <td>{salesData[1].businessSegmentNameEn}</td>
                    <td>{salesData[1].periodicValues[0].value.toFixed(2)}</td>
                    <td>{salesData[1].periodicValues[1].value.toFixed(2)}</td>
                    <td>{salesData[1].periodicValues[2].value.toFixed(2)}</td>
                    <td>{salesData[1].periodicValues[3].value.toFixed(2)}</td>
                    <td>{salesData[1].periodicValues[4].value.toFixed(2)}</td>
                    <td>{salesData[1].periodicValues[5].value.toFixed(2)}</td>
                  </tr>
                  <tr>
                    {" "}
                    <td>{salesData[2].businessSegmentNameEn}</td>
                    <td>{salesData[2].periodicValues[0].value.toFixed(2)}</td>
                    <td>{salesData[2].periodicValues[1].value.toFixed(2)}</td>
                    <td>{salesData[2].periodicValues[2].value.toFixed(2)}</td>
                    <td>{salesData[2].periodicValues[3].value.toFixed(2)}</td>
                    <td>{salesData[2].periodicValues[4].value.toFixed(2)}</td>
                    <td>{salesData[2].periodicValues[5].value.toFixed(2)}</td>
                  </tr>
                  <tr>
                    <td>{salesData[3].businessSegmentNameEn}</td>
                    <td>{salesData[3].periodicValues[0].value.toFixed(2)}</td>
                    <td>{salesData[3].periodicValues[1].value.toFixed(2)}</td>
                    <td>{salesData[3].periodicValues[2].value.toFixed(2)}</td>
                    <td>{salesData[3].periodicValues[3].value.toFixed(2)}</td>
                    <td>{salesData[3].periodicValues[4].value || 0.0}</td>
                    <td>{salesData[3].periodicValues[5].value || 0.0}</td>
                  </tr>

                  <tr>
                    <td>{salesData[4].businessSegmentNameEn}</td>
                    <td>{salesData[4].periodicValues[0].value || 0.0}</td>
                    <td>{salesData[4].periodicValues[1].value || 0.0}</td>
                    <td>{salesData[4].periodicValues[2].value || 0.0}</td>
                    <td>{salesData[4].periodicValues[3].value || 0.0}</td>
                    <td>{salesData[4].periodicValues[4].value || 0.0}</td>
                    <td>{salesData[4].periodicValues[5].value || 0.0}</td>
                  </tr>

                  <tr>
                    <td>{salesData[5].businessSegmentNameEn}</td>
                    <td>{salesData[5].periodicValues[0].value || 0.0}</td>
                    <td>{salesData[5].periodicValues[1].value || 0.0}</td>
                    <td>{salesData[5].periodicValues[2].value || 0.0}</td>
                    <td>{salesData[5].periodicValues[3].value || 0.0}</td>
                    <td>{salesData[5].periodicValues[4].value || 0.0}</td>
                    <td>{salesData[5].periodicValues[5].value || 0.0}</td>
                  </tr>
                  <tr>
                    <td>{salesData[6].businessSegmentNameEn}</td>
                    <td>{salesData[6].periodicValues[0].value || 0.0}</td>
                    <td>{salesData[6].periodicValues[1].value || 0.0}</td>
                    <td>{salesData[6].periodicValues[2].value || 0.0}</td>
                    <td>{salesData[6].periodicValues[3].value || 0.0}</td>
                    <td>{salesData[6].periodicValues[4].value || 0.0}</td>
                    <td>{salesData[6].periodicValues[5].value || 0.0}</td>
                  </tr>

                  <tr>
                    <td>{salesData[7].businessSegmentNameEn}</td>
